import React from "react";
import {Avatar, Grid, Paper} from '@material-ui/core'; // Grid version 2
import LockIcon from '@mui/icons-material/Lock';

const Login = () => {
    // add styles
    const paperStyle = {
        padding: 20,
        height: '70vh',
        width: 280,
        margin: '20px auto'
    }
    return (
        <Grid>
            <Paper elevation={20} style={paperStyle}>
                <Avatar>LockIcon</Avatar>
                Sign In
            </Paper>
        </Grid>
    )
}

export default Login;
